 import fotoPerfil from '../assets/foto-perfil.jfif';
 
 function PresentationCard() {
    let nombre = 'Daniel';

    return (
        <div className="presentation-card">
            <img src={fotoPerfil} alt="" />
            <h1>
                Hola, soy {nombre} estoy probando React
            </h1>
        </div>
    );
}

export default PresentationCard;
